  const getEmployees = () => {
    console.log("clicked");
    Axios.get("http://localhost:3001/employees").then((response) => {
      const newQuery = response.data;
      setQuery(newQuery);
    })
  }

  let result = (
    query.map((val, key) => {
      <div> {
        Object.keys(val).map((keyName, index) => {
          return (<p>
            {console.log(keyName + " " + val[keyName])}
            {keyName}: {val[keyName]}
          </p>)
        })
      }
      </div> 
  }));

return (
  <div className="App">
    <h1>Hello world</h1>
    <button onClick={getEmployees}>Get Employee</button>
  </div>
);
}

export default App;
